import React from "react";
import Background from './nftttt.jpg';
import './App.css';

function Home() {
  return (
    <body className="home">
      <div class="container">
        <div class="row align-items-center my-5">
          <div class="col-lg-7">
          <img alt="Featured" class="shadow_image" src="https://i.ibb.co/D1gChrJ/IMG-7207.jpg">
          </img>
          </div>
          <div class="col-lg-5" style={{color:'white'}}>
            <h1 class="font-weight-light">Ana Sayfa</h1>
            <p>
                NFT Bazaar Türkiye'nin ilk NFT alım-satım platformudur
            </p>
          </div>
        </div>
      </div>
    </body>
  );
}

export default Home;
